import { useState } from "react"

export function PersonInput(props:{
    readonly onChangeName:(text:string) => void;
    readonly onChangeSurame:(text:string) => void;
}) {
    const {onChangeName, onChangeSurame}=props;
    const [name, setName] = useState("");
    const [surname, setSurname] = useState("");

    return <>
        <div>PersonInput</div>
        <div>Username: <input type="text" placeholder="Inserisci nome" value={name} onChange={(ev) => {
            let newName=ev.target.value;
            setName(newName);
        }} /></div>
        <div>Password: <input type="text" placeholder="Inserisci cognome" value={name} onChange={(ev) => {
            let newSurname=ev.target.value;
            setSurname(newSurname);
        }} /></div>
        <button onClick={(ev) => {
            onChange(newName)
        }}>Salva</button>
    </>
}
